import { motion } from "framer-motion";
import { useState } from "react";
import { FiMenu, FiArrowRight } from "react-icons/fi";
import { DonationButton } from "./NarBarComponents/DonationButton";
import ribbonlogo from '../../assets/images/ribbonlogo.jpg'

export const FlipNavWrapper = () => {
  return (
    <div className="bg-transparent">
      <FlipNav />
      {/*<div className="h-40" />*/}
    </div>
  );
};

const FlipNav = () => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <nav className="flex justify-between items-center bg-tranparent p-4 border-b-[1px] border-gray-200 w-full">
      <div className="flex-1">
        <DonationButton />
      </div>
      <div className="flex flex-col items-center">
        <img src={ribbonlogo} style={{ width: '100px', height: 'auto' }} alt="Ribbon Logo" />
        <NavLeft setIsOpen={setIsOpen} />
        <NavMenu isOpen={isOpen} />
      </div>
      <div className="flex-1 flex justify-end">
      <span className='navbar-text'>
        <div className='social-icon'>
          <a href='https://www.linkedin.com/in/nicholas-buscemi-0023a9248/'><img src={navIcon1} alt='' /></a>
          <a href='https://github.com/nickbuscemi'><img src={githubIcon} alt='' /></a>
          <a href='https://www.instagram.com/'><img src={navIcon3} alt='' /></a>
          </div>
        </span>
      </div>
    </nav>
  );
};

